Implementing a queue using two stacks in Python can be a bit tricky, but it's a common approach to simulate a queue. Here's a basic implementation:

```python
class Stack:
    def __init__(self):
        self.items = []

    def is_empty(self):
        return len(self.items) == 0

    def push(self, item):
        self.items.append(item)

    def pop(self):
        if not self.is_empty():
            return self.items.pop()
        else:
            raise IndexError("pop from empty stack")

    def peek(self):
        if not self.is_empty():
            return self.items[-1]
        else:
            raise IndexError("peek from empty stack")

    def size(self):
        return len(self.items)

    def top(self):
        if not self.is_empty():
            return self.items[-1]
        else:
            raise IndexError("top from empty stack")

# Queue using two stacks
class Queue:
    def __init__(self):
        self.stack1 = Stack()
        self.stack2 = Stack()

    def is_empty(self):
        return self.stack1.is_empty() and self.stack2.is_empty()

    def enqueue(self, item):
        self.stack1.push(item)

    def dequeue(self):
        if self.is_empty():
            raise IndexError("dequeue from empty queue")
        item = self.stack1.pop()
        self.stack2.pop()
        return item

    def peek(self):
        if self.is_empty():
            raise IndexError("peek from empty queue")
        item = self.stack2.pop()
        return item

    def size(self):
        return self.stack1.size() + self.stack2.size()

# Example usage
if __name__ == "__main__":
    queue = Queue()

    # Enqueue items
    queue.enqueue(1)
    queue.enqueue(2)
    queue.enqueue(3)

    # Dequeue items
    print(queue.dequeue())  # Output: 1
    print(queue.dequeue())  # Output: 2
    print(queue.dequeue())  # Output: 3

    # Peek items
    print(queue.peek())  # Output: 3

    # Get the size of the queue
    print(queue.size())  # Output: 2

    # Peek at the last element
    print(queue.peek())  # Output: 3
```

### Explanation:
1. **Stack Class**: This class simulates a stack with `push`, `pop`, `peek`, `is_empty`, `size`, and `top` methods.
2. **Queue Class**: This class uses two stacks to implement a queue. The first stack is used for the left side of the queue (enqueue operation), and the second stack is used for the right side (dequeue operation).
3. **Methods**:
   - `is_empty`: Checks if both stacks are empty.
   - `enqueue`: Adds an item to the left (left side) stack.
   - `dequeue`: Removes an item from the right (right side) stack and from the left (left side) stack.
   - `peek`: Removes and returns an item from the left stack (left side).
   - `size`: Returns the total number of items in the queue.
   - `top`: Removes and returns an item from the right stack (right side).

This approach ensures that the operations on the queue are O(1) on average due to the nature of the stacks.
